import React from 'react';
import { render } from 'react-dom';
import ReactDOM from 'react-dom/client';
import './Rect.css';

function Rectangle() {
    class Rectangle extends React.Component {
      render() {
        return (
            <div className="rectangle" />
        );
      }
    }

}

export default Rectangle;
